tables.table_schema:
CREATE TABLE population_demographics (
id INT PRIMARY KEY,
name STRING,
age INT,
occupation STRING
);

CREATE TABLE study_results (
id INT PRIMARY KEY,
study_id INT,
participant_id INT,
result FLOAT,
study_date DATE
);

CREATE TABLE population_demographics (
    demographic_id INT PRIMARY KEY,
    age_group VARCHAR(50),
    gender VARCHAR(10),
    income_range VARCHAR(50)
);

CREATE TABLE geographic_location (
    location_id INT PRIMARY KEY,
    city VARCHAR(50),
    state VARCHAR(50),
    country VARCHAR(50)
);
